contracts/virus.sol.content:
pragma solidity ^0.4.19;

contract Virus {
    struct Virus {
        string name;
        uint level;
    }

    Virus[] public viruses;

    function _createViruses(string _name, uint _rna) internal {
        uint id = viruses.push(Virus(_name, 10)) - 1;
    }
}

